        txns.add(intIfy("a, b, d"));
        txns.add(intIfy("a, b, e, c"));

        FPGrowth.FPTree fpt = new FPGrowth().constructTree(txns, 0);
//        fpt.printTreeDebug();

        assertEquals(2, fpt.getSupport(intIfy("a, b")));
        assertEquals(0, fpt.getSupport(intIfy("a, b, c, d")));

